import Chart from 'react-apexcharts'
// import Button from '@mui/material/Button';

const SystemStats = () => {

    const state = {

        series: [75, 20],
        options: {
            chart: {
                height: 350,
                type: 'radialBar',
            },
            plotOptions: {
                radialBar: {
                    hollow: {
                        size: '70%',
                    }
                },
            },
            labels: ['Tank Level', 'Light'],
        },
    };
    return (
        <>
            <Chart
                options={state.options}
                series={state.series}
                type="radialBar"
                width={500}
                height={320} />
        </>
    );
}

export default SystemStats;
